import React from "react";
import { useParams, useLocation, useHistory,NavLink } from "react-router-dom";

const Sec = ({ match }) => {
  var { name, id } = useParams();
  var x = useLocation();
  var y = useHistory();
  return (
    <>
      <h1>
        This is body {name} {id} {x.pathname}
      </h1>
      <NavLink to={y.goBack()}><button onClick={() => y.goBack()}>Back</button></NavLink>
    </>
  );
};

export default Sec;
